import React from "react"
import App, { Container } from 'next/app'
import CustomHead from "../components/CustomHead"
import NavBar from "../components/NavBar"

class IndexPage extends App {
    render() {
       return (
           <Container>
               <CustomHead/>
               <NavBar>
               </NavBar>
           </Container>
       )
    }
}


export default IndexPage
